import React from 'react'
import { View, Image, StyleSheet } from 'react-native';
import SettingsScreen from "../SettingsScreen"
import FridgeScreen from '../FridgeScreen'
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

import { Ionicons } from "@expo/vector-icons";


const Tab = createBottomTabNavigator();

const bottomNavBar = () => {
  return (
      <Tab.Navigator
      screenOptions={{
        headerShown: false,
    }}
    >
        <Tab.Screen name="Hladilnik" component={FridgeScreen} options={{
              tabBarIcon: (tabInfo) => {
                return (
                    <Image
                    style={{height:20,width:14}}
                    source={require('../Icons/fridge.png')}
                    />
              );
                }
            }} />
        <Tab.Screen name="Nakupovalni list" component={SettingsScreen} options={{
              tabBarIcon: (tabInfo) => {
                return (
                    <Image
                    style={{height:20,width:20}}
                    source={require('../Icons/shopping_cart.png')}
                    />
              );
                }
            }} />
        <Tab.Screen name="Recepti" component={SettingsScreen} options={{
              tabBarIcon: (tabInfo) => {
                return (
                    <Image
                    style={{height:20,width:20}}
                    source={require('../Icons/restaurant.png')}
                    />
              );
                }
            }}/>
        <Tab.Screen name="Skupnost" component={SettingsScreen} options={{
              tabBarIcon: (tabInfo) => {
                return (
                    <Image
                    style={{height:20,width:20}}
                    source={require('../Icons/Community.png')}
                    />
              );
                }
            }}/>
        <Tab.Screen name="Mapa" component={SettingsScreen} options={{
            tabBarIcon: (tabInfo) => {
            return (
                <Image
                style={{height:20,width:20}}
                source={require('../Icons/maps.png')}
                />
            );
            }
        }}/>
      </Tab.Navigator>
  );
  
}
export default bottomNavBar;
